import React from 'react';
import { Link } from 'react-router-dom';
import './Header.css';

function Header() {
  return (
    <header className="navbar">
      <div className="navbar-logo">Aloha Turismo</div>
      <nav className="navbar-links">
        <Link to="/">Home</Link>
        <Link to="/alugueldeonibus">Aluguel de Ã”nibus</Link>
        <Link to="/turismo">Turismo</Link>
        <Link to="/nossafrota">Nossa Frota</Link>
        <Link to="/contato">Contato</Link>
      </nav>
    </header>
  );
}

export default Header;
